import './App.css';

function App() {
  return (
    <div className="App">
      <embed src="/music/the_unforgiven.mp3" width="180" height="90" loop="false" autostart="false" hidden="true" />
      <header className="App-header">
        <h1>New Blood Joins This Earth</h1>
        <h4>A retrospective on the Metallica Blacklist</h4>
      </header>
    </div>
  );
}

export default App;
